import {BUY_CAKE} from './cakeType'
const intialState={
    cake:[{
        name:'chocolet cake',
        type:'fasting',
        numOfCake:10
    }],

}

const reducer = (state = intialState,action)=>{
     switch(action.type){
        case BUY_CAKE:{
            return{
                ...state.cake,
                numOfCake:state.cake.numOfCake - 1
            }
        }
        default:return state
     }
    }
export default reducer
